import React from 'react'
import { StyledButton } from './StyledButton'

type Props = {
    text: string,
    background: string
}

export const Button = (props: Props) => {
    const { text } = props
  return (
    <StyledButton background='#1a1a1a'>{text}</StyledButton>
  )
}
